  return (
    <div className="home" style={{ backgroundImage: `url(${background})`}}>
      <div className="headerContainer" >    
      <h1>
          Hey, my name is Geral
      </h1> 
      <h2>
          Welcome to my website
      </h2>
        <Link to="About">
        <button>About Me</button>
        </Link>
      </div>
    </div>
  );
}

export default Home
